import React from "react";
import { StatusBar } from "expo-status-bar";
import {
	StyleSheet,
	Text,
	View,
	Image,
	SafeAreaView,
	ScrollView,
	TouchableHighlight,
	TouchableOpacity,
} from "react-native";

import AccountElement from "../components/account-element";

export default function Account() {
	const handleLogOut = () => {
		alert("Log Out clicked");
	};

	const handleElementClicked = name => {
		alert("Element clicked ", name);
	};
	return (
		<SafeAreaView>
			<View style={styles.marginContainer}>
				<Text style={styles.name}>Mateo Rubinstein</Text>
				<TouchableOpacity style={styles.logOutButton} onPress={handleLogOut}>
					<Text style={styles.logOutText}>Log Out</Text>
				</TouchableOpacity>
				<AccountElement name="Account" handler={handleElementClicked} />
				<AccountElement name="Wallet" handler={handleElementClicked} />
				<AccountElement name="Settings" handler={handleElementClicked} />

				<View style={styles.bottomElements}>
					<AccountElement
						name="Security measures"
						handler={handleElementClicked}
						bottomTab={true}
					/>
					<AccountElement
						name="About"
						handler={handleElementClicked}
						bottomTab={true}
					/>
				</View>
			</View>
		</SafeAreaView>
	);
}

const styles = StyleSheet.create({
	container: {
		flex: 1,
		backgroundColor: "#fff",
	},
	marginContainer: {
		marginHorizontal: "3%",
		padding: 8,
	},
	name: {
		fontSize: 30,
		fontWeight: "500",
	},
	logOutButton: {
		marginVertical: 7,
	},
	logOutText: {
		color: "#FF267C",
	},
	bottomElements: {
		marginTop: 400,
	},
});
